const Header = () => {
  return (
    <header style={styles.header}>
      <h1>My dream team</h1>
    </header>
  );
};

const styles = {
  header: {
    padding: "1em",
    color: "#6a0dad",
    textAlign: "center",
    fontWeight: "bold",
  },
};

export default Header;
